import React from "react";
import ReactDOM from 'react-dom';
import './index.css';
import state from './redux/state'
import App from './App';
import {addPost, addMessage, updateNewPostText} from './redux/state'

let rerendeEntireTree = (state) => {
    ReactDOM.render(<App appState={state} addPost={addPost} addMessage={addMessage} updateNewPostText={updateNewPostText} />,
        document.getElementById('root'));
}

rerendeEntireTree(state);

subscribe(rerendeEntireTree);
